import React from 'react';

function Homepage() {
        return (
            <div>
                <div class='navbar'>
                    <Link to="/homepage">Home</Link>
                    <Link to="/homepage">Meal Record</Link>
                    <Link to="/homepage">Recipe</Link>
                    <Link to="/homepage">Account</Link>
                    <Link to="/homepage">Transaction</Link>
                    <Link to="/homepage">Feedback</Link>
                    <Link to="/homepage">Loyalty</Link>
                    <Link to="/homepage">Diet plan</Link>
                </div>
                <h2>HomePage</h2>
                <p> Home Meal record Recipe Account Transaction Feedback Loyalty Diet plans</p>
            </div>
        );
    
}

export default Homepage;
